    struct Loan {
        uint256 principal;
        uint256 interestIndex;
    }

    uint256 private constant SECONDS_IN_YEAR = 31556926;

    uint256 private _totalSupply;
    uint256 public totalBorrows;
    uint256 public totalReserves;
    mapping(address => Loan) private _borrows;
    mapping(address => uint256) private _balance;
    uint256 public borrowIndex;
    address public underlying;

    uint256 public lastInterestTimestamp;
    uint256 public lastInterestBlock;
    uint256 public reserveFactor;

    InterestModel private _interestModel;
    Markets private _markets;
    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _initialExchangeRate;

    event Mint(address minter, uint256 amountUnderlying, uint256 tokensMinted);
    event Redeem(address redeemer, uint256 amountUnderlying, uint256 tokensRedeemed);
    event Borrow(address borrower, uint256 borrowAmount);
    event Repay(address borrower, address payer, uint256 repayAmount);
    event Liquidate(address liquidator, address borrower, uint256 amountToRepay, uint256 tokensToSeize);

    // solhint-disable-next-line
    constructor() ERC20("", "") {}

    function initialize(
        address underlying_,
        address interestModel,
        address markets,
        string memory name_,
        string memory symbol_,
        uint8 decimals_,
        uint256 initialExchangeRate,
        uint256 initialReserveFactor
    ) external initializer {
        underlying = underlying_;
        _interestModel = InterestModel(interestModel);
        _markets = Markets(markets);
        borrowIndex = 1e18;
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;
        _initialExchangeRate = initialExchangeRate;
        // solhint-disable-next-line
        lastInterestTimestamp = block.timestamp;
        lastInterestBlock = block.number;
        reserveFactor = initialReserveFactor;
    }

    /**
     * @notice User can mint cTokens by providing underlying asset.
     * @notice Received amount of cTokens depends on the exchange rate.
     * @notice Requires asset approval.
     * @param amount the amount of underlying asset to exchange for cTokens
     */
    function mint(uint256 amount) external {
        accrueInterest();

        _markets.canMint(address(this));

        uint256 tokensToMint = (amount * 1e18) / getExchangeRate();

        _totalSupply += tokensToMint;
        _balance[msg.sender] += tokensToMint;

        _transferAssetIn(msg.sender, amount);

        emit Mint(msg.sender, amount, tokensToMint);
        emit Transfer(address(this), msg.sender, tokensToMint);
    }

    /**
     * @notice User can redeem underlying asset by providing cTokens.
     * @notice Received amount of underlying asset depends on the exchange rate.
     * @notice Redeeming of tokens cannot undercollateralize user's loans.
     * @param amountToken the amount of cTokens to turn into underlying asset.
     */
    function redeem(uint256 amountToken) external {
        accrueInterest();
        uint256 tokensToRedeem = (amountToken * getExchangeRate()) / 1e18;

        _markets.canRedeem(address(this), msg.sender, tokensToRedeem);

        _totalSupply -= amountToken;
        _balance[msg.sender] -= amountToken;

        _transferAssetOut(msg.sender, tokensToRedeem);

        emit Transfer(msg.sender, address(this), amountToken);
        emit Redeem(msg.sender, tokensToRedeem, amountToken);
    }

    /**
     * @notice User can provide cTokens to redeem underlying asset.
     * @param amountUnderlying the amount of underlying asset to receive.
     */
    function redeemUnderlying(uint256 amountUnderlying) external {
        accrueInterest();
        uint256 tokensToRedeem = amountUnderlying / getExchangeRate();

        _markets.canRedeem(address(this), msg.sender, tokensToRedeem);

        _totalSupply -= tokensToRedeem;
        _balance[msg.sender] -= tokensToRedeem;

        _transferAssetOut(msg.sender, amountUnderlying);
    }

    function borrow(uint256 borrowAmount) external {
        accrueInterest();

        _markets.canBorrow(address(this), msg.sender, borrowAmount);
        require(_getCash() >= borrowAmount, "INSUFFICIENT_PROTOCOL_FUNDS");

        _borrows[msg.sender].principal = _getBorrowBalance(msg.sender) + borrowAmount;
        _borrows[msg.sender].interestIndex = borrowIndex;
        totalBorrows += borrowAmount;

        _transferAssetOut(msg.sender, borrowAmount);

        emit Borrow(msg.sender, borrowAmount);
    }

    function getBorrowBalance(address borrower) external view returns (uint256) {
        return _getBorrowBalance(borrower);
    }

    function _getBorrowBalance(address borrower) internal view returns (uint256) {
        if (_borrows[borrower].principal == 0) {
            return 0;
        }

        return (_borrows[borrower].principal * borrowIndex) / _borrows[borrower].interestIndex;
    }

    function repay(uint256 amount) external {
        accrueInterest();
        _repay(msg.sender, msg.sender, amount);
    }

    function _repay(
        address payer,
        address borrower,
        uint256 amount
    ) internal {
        _markets.canRepay(address(this), borrower);

        _borrows[borrower].principal = _getBorrowBalance(borrower) - amount;
        _borrows[borrower].interestIndex = borrowIndex;

        _transferAssetIn(payer, amount);

        emit Repay(borrower, payer, amount);
    }

    function liquidate(
        address borrower,
        CToken collateral,
        uint256 amountToRepay
    ) external {
        require(amountToRepay > 0, "INVALID_REPAY_AMOUNT");

        accrueInterest();
        collateral.accrueInterest();

        _markets.canLiquidate(this, collateral, msg.sender, borrower, amountToRepay);
        _repay(msg.sender, borrower, amountToRepay);
        uint256 amountTokensToSeize = _markets.calculateAmountTokensToSeize(this, collateral, amountToRepay);

        require(
            collateral.balanceOf(borrower) >= amountTokensToSeize,
            "INSUFFICIENT_COLLATERAL_BALANCE_TO_SEIZE"
        );

        if (collateral == this) {
            _seizeTokens(msg.sender, borrower, amountTokensToSeize);
        } else {
            collateral.seizeTokens(msg.sender, borrower, amountTokensToSeize);
        }

        emit Liquidate(msg.sender, borrower, amountToRepay, amountTokensToSeize);
    }

    function seizeTokens(
        address liquidator,
        address borrower,
        uint256 amount
    ) external {
        _markets.canSeize(address(this));
        _seizeTokens(liquidator, borrower, amount);
    }

    function _seizeTokens(
        address liquidator,
        address borrower,
        uint256 amount
    ) internal {
        _balance[borrower] -= amount;
        _balance[liquidator] += amount;

        emit Transfer(borrower, liquidator, amount);
    }

    /**
     * @notice returns information about important data belonging to account.
     * @param account the account for which to retrieve data
     * @return balance of the cToken
     * @return borrows in the underlying asset
     * @return exchangeRate between the cToken and underlying asset
     */
    function getAccount(address account)
        external
        view
        returns (
            uint256 balance,
            uint256 borrows,
            uint256 exchangeRate
        )
    {
        balance = _balance[account];
        borrows = _getBorrowBalance(account);
        exchangeRate = getExchangeRate();
    }

    /**
     * @notice returns the exchange rate between cToken and underlying asset.
     * @notice to calculate how many underlying can be received just multiply cToken amount by this exchange rate
     * @notice to calculate how many cTokens are needed to retrieve amount of underlying asset just divide that amount by this exchange rate
     * @return exchange rate
     */
    function getExchangeRate() public view returns (uint256) {
        //if there are no cTokens minted yet, we return an initial exchange rate set on initialization
        //this is necessary to avoid division by zero error
        if (_totalSupply == 0) {
            return _initialExchangeRate;
        }

        uint256 totalCash = _getCash();

        /**
         * The formula for calculating exchange rate uses four parameters
         * totalCash is the amount of underlying asset in the contract
         * totalBorrows which indicates how much of the underlying asset is due to return to this contract
         * totalReserves is the amount of underlying asset reserved for protocol purposes
         * totalSupply denotes how many cTokens are currently in circulation
         *
         * The formula is simple:
         * totalCash + totalBorrows indicates how much of the underlying asset is expected to be in the contract
         * then we subtract reserves which will never be used by users
         * and all that is divided by totalSupply.
         */
        return ((totalCash + totalBorrows - totalReserves) * 1e18) / _totalSupply;
    }

    function accrueInterest() public {
        //accrue interest only once per block
        if (lastInterestBlock == block.number) {
            return;
        }

        //calculate time elapsed since last accrual
        // solhint-disable-next-line
        uint256 timeDelta = block.timestamp - lastInterestTimestamp;
        uint256 interestRate = _interestModel.getInterestRate(_getCash(), totalBorrows, totalReserves);
        //calculate interest factor for every second that passed since last update
        uint256 interestFactor = (interestRate * timeDelta) / SECONDS_IN_YEAR;
        //apply interest factor to borrows
        uint256 interestAccumulated = (totalBorrows * interestFactor) / 1e18;

        //update state
        lastInterestBlock = block.number;
        // solhint-disable-next-line
        lastInterestTimestamp = block.timestamp;

        totalBorrows += interestAccumulated;
        totalReserves += (interestAccumulated * reserveFactor) / 1e18;
        borrowIndex += (borrowIndex * interestFactor) / 1e18;
    }

    function getCash() external view returns (uint256) {
        return _getCash();
    }

    function _getCash() internal view returns (uint256) {
        return ERC20(underlying).balanceOf(address(this));
    }

    function _transferAssetIn(address account, uint256 amount) internal {
        ERC20(underlying).safeTransferFrom(account, address(this), amount);
    }

    function _transferAssetOut(address account, uint256 amount) internal {
        ERC20(underlying).safeTransfer(account, amount);
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balance[account];
    }

    function name() public view override returns (string memory) {
        return _name;
    }

    function symbol() public view override returns (string memory) {
        return _symbol;
    }

    function decimals() public view override returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal override {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        _markets.canTransfer(address(this), sender, amount);

        _beforeTokenTransfer(sender, recipient, amount);

        uint256 senderBalance = _balance[sender];
        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
        unchecked {
            _balance[sender] = senderBalance - amount;
        }
        _balance[recipient] += amount;

        emit Transfer(sender, recipient, amount);

        _afterTokenTransfer(sender, recipient, amount);
    }

    //TODO: add access control
    function setReserveFactor(uint256 newReserveFactor) external {
        reserveFactor = newReserveFactor;
    }

    //TODO: add access control
    function setInterestModel(address newInterestModel) external {
        require(newInterestModel != address(0), "INVALID_INTEREST_MODEL");
        _interestModel = InterestModel(newInterestModel);
    }

    
}
","keccak256":"0x6eeedcdb811b462d57490f857c13b41cf58bebd571e503cde2f0e9f7e930c1a8","license":"MIT"},"contracts/Markets.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

import "./PriceFeed.sol";
import "./CToken.sol";

import "hardhat/console.sol";

//TODO: consider making this upgradeable
contract Markets is AccessControl {
    using SafeERC20 for IERC20;

    bytes32 public constant GOVERNOR = keccak256("GOVERNOR");

    struct Market {
        bool isListed; //TODO: should listing/delisting be governed?
        uint256 collateralFactor; //TODO: should collateralFactor be governed?
        mapping(address => bool) membership;
    }

    mapping(address => Market) public markets;
    address[] public allMarkets;
    mapping(address => CToken[]) public accountAssets;

    //TODO: need a way to change oracle, add a setter
    PriceFeed private _oracle;

    uint256 public liquidationIncentive;

    event MarketEnabled(address token);
    event MarketDisabled(address token);
    event MarketEntered(address token, address account);

    constructor(address oracle) {
        _oracle = PriceFeed(oracle);
        liquidationIncentive = 1e18;
        //TODO: get governance address and setup role
        _setupRole(GOVERNOR, msg.sender);
    }

    function enterMarket(address asset) external {
        require(markets[asset].isListed, "UNLISTED_MARKET");
        if (!markets[asset].membership[msg.sender]) {
            markets[asset].membership[msg.sender] = true;
            accountAssets[msg.sender].push(CToken(asset));
            emit MarketEntered(asset, msg.sender);
        }
    }

    function canMint(address asset) external view {
        require(markets[asset].isListed, "UNLISTED_MARKET");
    }

    function canRedeem(
        address asset,
        address account,
        uint256 amountToRedeem
    ) external view {
        _canRedeem(asset, account, amountToRedeem);
    }

    function _canRedeem(
        address asset,
        address account,
        uint256 amountToRedeem
    ) internal view {
        require(markets[asset].isListed, "UNLISTED_MARKET");
        if (!markets[asset].membership[account]) {
            //so we skip collateral check
            return;
        }
        //check if redeemed amount will not undercollateralize account
        (, uint256 shortfall) = _getAccountLiquidityUpdated(asset, account, 0, amountToRedeem);
        require(shortfall == 0, "INSUFFICIENT_LIQUIDITY");
    }

    function canTransfer(
        address asset,
        address from,
        uint256 amount
    ) external view {
        //we only need to check if redeeming amount of ctokens is allowed
        _canRedeem(asset, from, amount);
    }

    function canBorrow(
        address asset,
        address borrower,
        uint256 borrowAmount
    ) external view {
        require(markets[asset].isListed, "UNLISTED_MARKET");
        require(markets[asset].membership[borrower], "MARKET_NOT_ENTERED");
        (uint256 liquidity, ) = _getAccountLiquidityUpdated(asset, borrower, borrowAmount, 0);
        require(liquidity > 0, "INSUFFICIENT_LIQUIDITY");
    }

    function canRepay(address asset, address borrower) external view {
        require(markets[asset].isListed, "UNLISTED_MARKET");
        require(markets[asset].membership[borrower], "MARKET_NOT_ENTERED");
    }

    function canLiquidate(
        CToken assetBorrowed,
        CToken assetCollateral,
        address liquidator,
        address borrower,
        uint256 amountToRepay
    ) external view {
        require(markets[address(assetBorrowed)].isListed, "UNLISTED_MARKET_BORROWED");
        require(markets[address(assetCollateral)].isListed, "UNLISTED_MARKET_COLLATERAL");
        require(liquidator != borrower, "LIQUIDATOR_CANNOT_BE_BORROWER");
        (, uint256 shortfall) = _getAccountLiquidity(borrower);
        require(shortfall > 0, "INSUFFICIENT_SHORTFALL");
        uint256 borrowBalance = assetBorrowed.getBorrowBalance(borrower);
        require(amountToRepay <= borrowBalance, "TOO_MUCH_TO_REPAY");
    }

    function canSeize(address asset) external view {
        require(markets[asset].isListed, "UNLISTED_MARKET");
    }

    /**
     * @param amountToRepay the amount of borrowed underlying to convert to collateral cToken
     */
    function calculateAmountTokensToSeize(
        CToken borrowed,
        CToken collateral,
        uint256 amountToRepay
    ) external view returns (uint256) {
        //Get prices for both borrowed and collateral underlying tokens
        uint256 priceBorrowed = _oracle.getPrice(borrowed);
        uint256 priceCollateral = _oracle.getPrice(collateral);

        //Calculate the amount of collateral tokens to seize
        uint256 exchangeRateCollateral = collateral.getExchangeRate();

        uint256 collateralUnderlyingAmount = (amountToRepay * priceBorrowed * liquidationIncentive) /
            priceCollateral;
        uint256 amountTokensToSeize = collateralUnderlyingAmount / exchangeRateCollateral;

        return amountTokensToSeize;
    }

    function getAccountLiquidity(address borrower) external view returns (uint256, uint256) {
        return _getAccountLiquidity(borrower);
    }

    function _getAccountLiquidity(address borrower) internal view returns (uint256, uint256) {
        return _getAccountLiquidityUpdated(address(0), borrower, 0, 0);
    }

    struct LiquidityCalc {
        uint256 price;
        uint256 balance;
        uint256 borrows;
        uint256 exchangeRate;
        uint256 collateralFactor;
    }

    function _getAccountLiquidityUpdated(
        address borrowOrRedeemAsset,
        address borrower,
        uint256 borrowAmount,
        uint256 redeemAmount
    ) internal view returns (uint256, uint256) {
        require(borrowAmount == 0 || redeemAmount == 0, "BORROW_OR_REDEEM_MUST_BE_ZERO");
        CToken[] memory assets = accountAssets[borrower];

        uint256 sumCollateral = 0;
        uint256 sumBorrows = 0;
        for (uint256 i = 0; i < assets.length; i++) {
            CToken asset = assets[i];
            //using struct because of stack too deep errors
            LiquidityCalc memory vars;

            vars.price = _oracle.getPrice(asset);
            (vars.balance, vars.borrows, vars.exchangeRate) = asset.getAccount(borrower);
            vars.collateralFactor = markets[address(asset)].collateralFactor;
            uint256 normalizer = ((vars.collateralFactor * vars.exchangeRate) / 1e18) * vars.price;
            sumCollateral += (vars.balance * normalizer) / 1e18;
            sumBorrows += vars.borrows * vars.price;

            if (borrowOrRedeemAsset == address(asset)) {
                sumBorrows += borrowAmount * vars.price;
                sumBorrows += (redeemAmount * normalizer) / 1e18;
            }
        }

        if (sumCollateral > sumBorrows) {
            return (sumCollateral - sumBorrows, 0);
        } else {
            return (0, sumBorrows - sumCollateral);
        }
    }

    function getBorrowingLimitUsed(address borrower) external view returns (uint256) {
        CToken[] memory assets = accountAssets[borrower];

        uint256 sumBorrows = 0;
        for (uint256 i = 0; i < assets.length; i++) {
            CToken asset = assets[i];
            //using struct because of stack too deep errors
            LiquidityCalc memory vars;

            vars.price = _oracle.getPrice(asset);
            (, vars.borrows, ) = asset.getAccount(borrower);
            sumBorrows += vars.borrows * vars.price;
        }

        return sumBorrows;
    }

    function enableMarket(address collateralToken, uint256 collateralFactor) external onlyRole(GOVERNOR) {
        require(!markets[collateralToken].isListed, "MARKET_ALREADY_LISTED");
        //TODO: will probably also need to setup initial borrowing index and other factors
        markets[collateralToken].isListed = true;
        markets[collateralToken].collateralFactor = collateralFactor;
        _trackMarket(collateralToken);
        emit MarketEnabled(collateralToken);
    }

    function _trackMarket(address token) internal {
        for (uint256 i = 0; i < allMarkets.length; i++) {
            require(allMarkets[i] != token, "MARKET_ALREADY_ADDED");
        }
        allMarkets.push(token);
    }

    function disableMArket(address collateralToken) external onlyRole(GOVERNOR) {
        require(markets[collateralToken].isListed, "MARKET_ALREADY_DELISTED");
        markets[collateralToken].isListed = false;
        emit MarketDisabled(collateralToken);
    }

    function getAllMarkets() external view returns (address[] memory) {
        return allMarkets;
    }

    function isEntered(address collateralToken, address borrower) external view returns (bool) {
        return markets[collateralToken].membership[borrower];
    }

    function setLiquidationIncentive(uint256 newLiquidationIncentive) external onlyRole(GOVERNOR) {
        require(newLiquidationIncentive >= 1e18, "LIQUIDATION_INCENTIVE_MUST_BE_GREATER_THAN_1");
        liquidationIncentive = newLiquidationIncentive;
    }
}
